import "./FirmFund.css";

function FirmFund() {
  return (
    <div className="firmFund">
      <div className="">
        <img
          src="https://i.pinimg.com/originals/ba/fc/15/bafc1525cef9606c5c064694ca8e60fb.jpg"
          alt=""
          className="firmFund_image"
        />
      </div>
    </div>
  );
}

export default FirmFund;
